package ch.post.it.evoting.controlcomponents.returncodes.service;

import static org.junit.jupiter.api.Assertions.assertTrue;
import static org.mockito.Mockito.when;

import java.math.BigInteger;
import java.security.KeyManagementException;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import org.mockito.Mockito;

import ch.post.it.evoting.controlcomponents.returncodes.crypto.CryptoUtils;
import ch.post.it.evoting.cryptolib.elgamal.bean.ElGamalPrivateKey;
import ch.post.it.evoting.cryptolib.mathematical.groups.impl.Exponent;
import ch.post.it.evoting.cryptolib.primitives.service.PrimitivesService;

class VoterReturnCodeGenerationKeyDerivationServiceTest {
	private static final String VERIFICATION_CARD_ID = "394cbc1c2288400daa4597646ce72db2";

	private static final BigInteger Q = new BigInteger(
			"");

	private final PrimitivesService primitivesService = Mockito.mock(PrimitivesService.class);

	private VoterReturnCodeGenerationKeyDerivationService voterReturnCodeGenerationKeyDerivationService;

	@BeforeEach
	public void setUp() throws KeyManagementException {
		voterReturnCodeGenerationKeyDerivationService = new VoterReturnCodeGenerationKeyDerivationService(primitivesService);
	}

	@Test
	void testDeriveKeyHappyPath() throws Exception {

		when(primitivesService.getKDFDeriver()).thenReturn(CryptoUtils.getKDFDeriver());

		final String elGamalPrivateKeyJson = "{\"privateKey\":{\"zpSubgroup\":{\"g\":\"Ag==\",\"p\":\"\",\"q\":\"\"},\"exponents\":[\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\",\"\"]}}";
		final ElGamalPrivateKey privateKey = ElGamalPrivateKey.fromJson(elGamalPrivateKeyJson);
		final Exponent exponent = privateKey.getKeys().get(0);
		final Exponent cryptoAPIDerivedKey = voterReturnCodeGenerationKeyDerivationService
				.deriveVoterReturnCodeGenerationPrivateKey(exponent, VERIFICATION_CARD_ID, Q);

		assertTrue(cryptoAPIDerivedKey.getValue().compareTo(Q) < 0);
	}
}
